import React from 'react'
import axios from 'axios'
import { useEffect,useState } from 'react'
import {Link} from 'react-router-dom'

const CommissionList = () => {
    const [commissions, setCommissions] = useState([])
    useEffect(() =>{
        const fetchAllCommission = async ()=>{
            try{
                const res = await axios.get("http://localhost:8800/commission")
                setCommissions(res.data)
            }
            catch(err){
                console.log(err)
            }
        }
        fetchAllCommission()
    }, [])
  return (
    <div>
      <h1>Commission List</h1>
      <div className="commissions">
        {commissions.map(Commission=>(
            <div className="commission" key={Commission.userID}>
                
                <h2>{Commission.Title}</h2>
                <p>{Commission.Deadline}</p>
                <p>{Commission.Location}</p>
                <p>{Commission.Type}</p>
                <p>{Commission.Description}</p>
                <p>{Commission.Pay}</p>
                <p>{Commission.Status}</p>
                <p>{Commission.DatePosted}</p>
                <p>{Commission.DateCompleted}</p>
                <p>{Commission.ContactNo}</p>
            
            </div>
        ))}
      </div>
      <button>
        <Link to='/add'>Add account</Link>
        </button>
    </div>
  )
}

export default CommissionList
